import React from 'react';
import SingleOffer from './SingleOffer';
import './OffersList.css'

const OffersList = () => {
    const offers = []
    const list = offers.map(offer => <SingleOffer props={offer}/>);
    return (
        <table>
            <tr>
                <th>Title</th>
                <th>Link</th>
                <th>Company</th>
                <th>Country</th>
                <th>City</th>
                <th>Field</th>
                <th>Paygrade</th>
                <th>Favorite</th>
                <th>Applied</th>
                <th>Stage 1</th>
                <th>Stage 2</th>
                <th>Stage 3</th>
                <th>Got the job</th>
            </tr>
            {list}
        </table>
    )
}

export default OffersList;
